import React from "react";
import HomePage from "./pages/home";
import { Route, Routes, useLocation, Switch } from "react-router-dom";
import AboutPage from "./pages/about";
import TicTac from "./pages/projects/TicTac";
import Calculator from "./pages/projects/calc";
import Projects from "./pages/projects";

function RouteWrapper() {
    const location = useLocation().pathname;
    console.log(location)
    return (
        // <Switch>
        //     <Route exact path="/">
        //       <HomePage />
        //     </Route>
        //     <Route path="/about">
        //       <AboutPage />
        //     </Route>
        //     <Route path="/projects">
        //       <Projects />
        //     </Route>
        //     <Route path="/projects/tictac">
        //       <TicTac />
        //     </Route>
        //     <Route path="/projects/calculator">
        //       <Calculator />
        //     </Route>
        //   </Switch>
        <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/#/about" element={<AboutPage/>} />
            <Route path="/#/projects/tictac" element={<TicTac/>} />
            <Route path="/projects/calculator" element={<Calculator/>} />
            <Route path="/projects/" element={<Projects/>}/>
        </Routes>
    )
}
export default RouteWrapper;
